📚BOOK REVIEW 📚
Mistletoe and Mr.Right. PUB day Oct 2020. By Sarah Morgenthaler
Thank you @sourcebookscasa @netgalley for my ARC
.
Synopsis
Moose Springs Alaska is trying hard not to become a tourist town. The Montgomery Group has bought up everything in sight in hopes of building resort condos. The holidays are fast approaching, a rogue moose with a preference for twinkly lights is determined to wreak havoc, and Lana Montgomery is on a mission to save it all. Lana is trying hard to fit in, in a town set on keeping her out. Home is something Lana has always dreamt of, a place and people that she can come back to and her heart is set on Moose Springs. Rick owns the local pool hall and times have been tough, A failed marriage and a failing business but there is something about Lana. 
Can Rick and Lana save Moose Springs and eachother?

Review
Small town boy, rich girl, and a moose- whats not to love? This is a feel good book! It is not complicated, doesn’t make you think, there are no mysteries to solve, it is the perfect light,fluffy, lose yourself romance everyone wants. The author paints a story of a picturesque town where everyone knows each others business. The reader is introduced to the “townies”- Rick, Zooey, Graham, Jonah, Ash, and Easton. Each has his/her own story, connection to Lana, and vested interest in the town. The author provides rich dialogue, witty banter and off the cuff humour between her characters making it an easy read. We learn about Lana and her families high expectations, billion dollar company and dysfunctional relationships. The authors writing encourages the reader to see Lana for her personality, quirks, and compassion and not for her money. As a reader I felt sorry for Lana and wanted her to come out on top. 
This book wont be life changing or epic but it will give you a few hours away from yourself as you slide into life in Moose Springs- bring your cocoa and a blanket and snuggle in.
.
